import React from 'react'


export default function HeadlineWithImg(props) {

    
    return (
        <div className="headlineWithImg">
            <div className="article-img"><img src={props.imgURL} alt="" srcSet=""/></div>
            <div className="headline"><a href={props.url}>{props.headline}</a></div>
            
        </div>
    )
}
